import React from 'react'
import SearchIcon from '@material-ui/icons/Search';
import "./Styles.css"
import ButtonGroup from "@material-ui/core/ButtonGroup";
import Button from "@material-ui/core/Button";

function Search() {
  return (
  <div>
    <div style={{display: "flex", justifyContent: "center", marginBottom: 10}}>
      <ButtonGroup variant="text" color="primary" aria-label="text primary button group">
        <Button style={{width: 150}}>Goal-Step</Button>
        <Button style={{width: 150}}>Graph</Button>
      </ButtonGroup>
    </div>
    <div style={{display: "flex", alignItems: "center", justifyContent: "center"}}>
      <div className={"searchDiv"}>
        <input type="text" name="name" className={"searchInput"}/>
      </div>

      <div className={"searchButton"}>
        <SearchIcon style={{color: "white"}}/>
      </div>
    </div>
  </div>
  )
}

/* Redux */
const mapStateToProps = (state) => {
  return {
    layout: state.layoutReducer.layout,
    navBar: state.layoutReducer.navBar,
    navBarLayout: state.layoutReducer.navBarLayout
  }
}
const mapDispatchToProps = (dispatch) => {
  return {
    setNavBar: () => dispatch(toggleNav())
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(Search)
